import React, { useState } from 'react';
import { Link } from 'react-router-dom';

// Move validateField outside of validateInputs
const validateField = (fieldName, value, regex, errorMessage, setErrorMessages) => {
  if (!value || (regex && !regex.test(value))) {
    setErrorMessages((prevErrors) => ({
      ...prevErrors,
      [fieldName]: errorMessage,
    }));
    return false;
  } else {
    setErrorMessages((prevErrors) => ({ ...prevErrors, [fieldName]: '' }));
    return true;
  }
};

function SignInPage() {
  const [FullName, setFullName] = useState('');
  const [Mobile, setMobile] = useState('');
  const [Email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [errorMessages, setErrorMessages] = useState({
    FullName: '',
    Mobile: '',
    Email: '',
    password: '',
  });

  const handleSubmit = (e) => {
    e.preventDefault();

    const isValid = validateInputs();

    if (isValid) {
      console.log('Form submitted:', {
        FullName,
        Mobile,
        Email,
        password,
      });
      // No need to programmatically navigate, Link will handle it
    } else {
      console.log('Form submission failed. Please check the fields.');
    }
  };

  const validateInputs = () => {
    const nameRegex = /^[A-Za-z. ]{3,}$/;
    const mobileRegex = /^[9876][0-9]{0,9}$/;
    const emailRegex = /^[^\s@]+@[^\s@]+\.(com|in)$/;
    const passwordRegex = /^[A-Za-z.0-9!@#$%^&*]{0,}$/;

    let isValid = true;

    // Use validateField here
    isValid = isValid && validateField('FullName', FullName, nameRegex, 'Please enter a valid full name.', setErrorMessages);
    isValid = isValid && validateField('Mobile', Mobile, mobileRegex, 'Please enter a valid 10-digit mobile number.', setErrorMessages);
    isValid = isValid && validateField('Email', Email, emailRegex, 'Please enter a valid email address.', setErrorMessages);
    isValid = isValid && validateField(
      'password',
      password,
      passwordRegex,
      'Password must be at least 8 characters, contain at least one letter, one number, and one special character.',
      setErrorMessages
    );

    return isValid;
  };

  return (
    <div className='org'>
      <h2>SignIn forher</h2>
      <form className='forinner container' onSubmit={handleSubmit}>
        <div className='form-group'>
          <label>Full Name <span style={{ color: 'red' }}>*</span> :</label>
          <input
            type='text'
            className='form-control'
            placeholder='ex: FullName'
            value={FullName}
            onChange={(e) => setFullName(e.target.value)}
          />
          <p className='error-message'>{errorMessages.FullName}</p>
        </div>

        <div className='form-group'>
          <label>Mobile <span style={{ color: 'red' }}>*</span> :</label>
          <input
            type='text'
            className='form-control'
            placeholder='ex: 9876543210'
            value={Mobile}
            onChange={(e) => setMobile(e.target.value.slice(0, 10))}
          />
          <p className='error-message'>{errorMessages.Mobile}</p>
        </div>

        <div className='form-group'>
          <label>Email <span style={{ color: 'red' }}>*</span> :</label>
          <input
            type='text'
            className='form-control'
            placeholder='ex: example123@gmail.com'
            value={Email}
            onChange={(e) => setEmail(e.target.value)}
          />
          <p className='error-message'>{errorMessages.Email}</p>
        </div>

        <div className='form-group'>
          <label>Password <span style={{ color: 'red' }}>*</span> :</label>
          <input
            type='password'
            className='form-control'
            placeholder='ex: Abc@123'
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
          <p className='error-message'>{errorMessages.password}</p>
        </div>

        <button className='btn btn-success my-2' type='submit'>
          Sign In
        </button>

        {/* Link to the success page */}
        <p>
          Already have an account? <Link to='/success'>Go to Success Page</Link>
        </p>
      </form>
    </div>
  );
}

export default SignInPage;
